// src/components/PaymentMethodSelection.js
import React from 'react';
import { Link } from 'react-router-dom';
import './PaymentMethodSelection.css';

const PaymentMethodSelection = () => {
  return (
    <div className="payment-method-selection">
      <h2>Select Payment Method</h2>
      <div className="payment-method-card">
        <img src="/images/fawry-logo.png" alt="Fawry" />
        <Link to="/fawry" className="payment-method-link">Pay with Fawry</Link>
      </div>
      <div className="payment-method-card">
        <img src="/images/digital-wallet-logo.png" alt="Digital Wallet" />
        <Link to="/digital-wallet" className="payment-method-link">Pay with Digital Wallet</Link>
      </div>
      <div className="payment-method-card">
        <img src="/images/credit-card-logo.png" alt="Credit Card" />
        <Link to="/credit-card" className="payment-method-link">Pay with Credit Card</Link>
      </div>
    </div>
  );
};

export default PaymentMethodSelection;
